import axios from 'axio'

const Home = () => {
    const [posts, setPosts] = useState(null)

    useEffect(() => {
        axios.get('/api/posts')
    .then(response => console.log(response.posts))
    .catch(error => console.error('Error:', error));
    }, [])

  return (
    <div className='home'>
        <div className="posts">
            {posts && posts.map((post) => {
                <p key={post._id}>{post.title}</p>
            })}
        </div>
    </div>
  )
}

export default Home
